■〓■〓■〓■〓■〓■〓■〓■〓■〓■〓■〓■〓<BR>※パンツの裾上げに関しましては一度お客様で着用して頂き
長さを合わせて頂いた上で、<BR> 裾上げをして頂いた方がよりジャストサイズにて
着用して頂けると思います為、<BR> 誠に申し訳御座いませんが、
弊社ではパンツの裾上げを承っておりませんので宜しくお願い申し上げます<BR>

■〓■〓■〓■〓■〓■〓■〓■〓■〓■〓■

21.75オンス 左綾SUPER　HEAVY　WEIGHT　オリジナルセルビッチデニム
<BR>
WEST RIDEの新定番DENIM
<BR>
WR201。左綾のオリジナルセルビッチデニムを使用したストレートタイプ<BR><BR>
各部トリプルステッチ、脇割りダブルステッチ。縫製糸には耐久性などを考慮し各部にコアスパン糸を使用し、ジーンズでありながらワークパンツの要素が随所に組み込まれています。
<BR>
独特の形状をしたベルトループでWEST RIDEらしさ、オリジナルの鉄製ボタン、オリジナルUFOリベット、ヘアーオンラベルなどビンテージのデティールをMIXして出来上がった究極のDENIM PANTSです。<BR>
