■〓■〓■〓■〓■〓■〓■〓■〓■〓■〓■

若干深めの股上と、ややゆとりのあるヒップ回り、<BR>緩やかにテーパードした履き心地は正に定番！<BR>ディテールにも拘り、インシーム裏側の巻縫い縫製はWRANGLER、アウトシームのセルビッジに走るダブルのチェーンロックはLEE、ウエストバンドに入るチェーンステッチはXX。<BR><BR>各ビンテージデニムに採用されたデイテール・スペックを随所に取り入れつつ、完全オリジナルのデニムパンツに仕上げています！
<BR>


ヒップポケットに施されたステッチラインは、今ではOLD BIKE PARTSで有名なヘリングス社のハンドルバーへのオマージュ。<BR><BR>左綾仕様のデニムパンツでポケットステッチ入りというのはWESTRIDE初のモデルとなります。<BR>SWASTIKAデザインが刻されたオリジナルボタンは戦前から続くウエストライドブランドの長い社歴を示唆する設定。<BR><BR>


