INTERBREED インターブリード <br><br>
INTERBREED FISHING/OUTDOOORライン"PHAT BITE"より高機能素材SUPPLEX NYLONを使用した、ショーツとしても着用可能な2WAYパンツです。<br>
SUPPLEX NYLONとは、デュポン社のブランドで、軽量かつ優れた速乾性、縮み/色あせ/型崩れに強い特性を兼ね備え、綿のような心地良い肌触りのハイテク素材です。<br>
非常に肌触りの良い素材感は、発汗時にベタつかず、様々なシーンでの活躍が期待できます。<br>
型は、適度な太さのシルエットを採用し、腿部分に付属したZIPにより、ショーツとしても着用可能な機能性の高い仕上がりとなります。<br>
また、ウェスト周りにはゴム+丸紐のイージー仕様、裾にはドローコードが付属し、軽量な素材感と相まって非常に快適な一本です。<br>
左腿ZIP付近には同色でロッドモチーフの刺繍が入ります。 機能性を追求し、装飾を省いたソリッドルな見た目は、様々なスタイルに取り入れやすいデザインでは無いでしょうか。<br>
アウトドアはもちろんの事、タウンユースにおいても機能美を発揮する今季オススメのパンツです。<br>
色違いで、ブラックやネイビーもございます。<br><br>
・着用サイズ例：身長160cm 55kg Mサイズ着用<br><br>
・サイズ：ロングパンツ<br>
M : ウエスト74cm 股上30cm 股下77cm<br>
L : ウエスト78cm 股上31cm 股下78cm<br>
XL : ウエスト82cm 股上32cm 股下79cm<br><br>
